const API_CALL_SUCCESS = "API_CALL_SUCCESS";
const initialState = {
    data: []
};
export function ReduxProduct(state = initialState, action) {
    switch (action.type) {
        case API_CALL_SUCCESS:
            return {
                ...state
            };

    }
    console.log(initialState)
}
